/** @brief Home brewing controller/devices.  This identifies the individual piece of equipment.  This can be a specific brand or project */
#ifndef HAVE_ENUM_BREWLINK_DEVICES
#define HAVE_ENUM_BREWLINK_DEVICES
enum BREWLINK_DEVICES
{
	BREWLINK_BREW_CONTROLLER_GENERIC=0, /* Generic Homebrew controller. | */
	BREWLINK_DIGITAL_THERMOMETER=1, /* Generic digital thermometer | */
	BREWLINK_DEVICES_ENUM_END=2, /*  | */
};
#endif

/** @brief  */
#ifndef HAVE_ENUM_BREWLINK_DEVICE_TYPE
#define HAVE_ENUM_BREWLINK_DEVICE_TYPE
enum BREWLINK_DEVICE_TYPE
{
	BREWLINK_REFRIGERATOR_CONTROLLER=0, /* Basic refrigeration controller. | */
	BREWLINK_HEATER_CONTROLLER=1, /* Basic heating element controller. | */
	BREWLINK_DUAL_LOOP_CONTROLLER=2, /* Basic dual loop temperature controller. | */
	BREWLINK_TEMPERATURE_SENSOR=3, /* Basic digital temperature sensor | */
	BREWLINK_DEVICE_TYPE_ENUM_END=4, /*  | */
};
#endif

/** @brief Flags used to describe the modes of the brew controller */
#ifndef HAVE_ENUM_BREWLINK_MODE_FLAG
#define HAVE_ENUM_BREWLINK_MODE_FLAG
enum BREWLINK_MODE_FLAG
{
	BREWLINK_MODE_DEFAULT=0, /* Default for devices that don't have different modes. | */
	BREWLINK_MODE_MANUAL=1, /* Indicates that device is under manual control. | */
	BREWLINK_MODE_AUTOMATIC=2, /* Indicates that device is under automatic control. | */
	BREWLINK_MODE_HEATING=4, /* Indicates that device's heater output is active | */
	BREWLINK_MODE_COOLING=8, /* Indicates that device's cooling output is active. | */
	BREWLINK_MODE_RUNNING=16, /* Indicates that device is running.  Could be used for pumps etc. | */
	BREWLINK_MODE_PARAMETER_OUT_OF_RANGE=32, /* Indicates that a critical parameter has exceeded a preset threshold. | */
	BREWLINK_MODE_LOW_BATTERY=64, /* Indicates that device has detected a low battery state. | */
	BREWLINK_MODE_FAULT=128, /* Indicates that device has entered a fault mode. | */
	BREWLINK_MODE_FLAG_ENUM_END=129, /*  | */
};
#endif

